    @Test
    public void nihao() {
        Date date=new Date();
        while(arg.indexOf("()")!=-1){
            arg= arg.replace("()","");
        }
        System.out.println(arg.length()+"====="+(new Date().getTime()-date.getTime()));
    }

    @Test
    public void testTwo() throws Exception {
        //o(n) 2n 
        Date date=new Date();
        char[] a =arg .toCharArray();
        int ans = a.length, length = ans;
        for (int i = 0, j = 0; i < length && j < length;) {
            if (a[i] != '(') {
                i++;
                continue;
            } else {
                j=i>j?i:j; //ji
                if(a[j]==')'){
                    ans=ans-2;
                    i++;
                }
                j++;
            }
        }
        System.out.println(ans+"====="+(new Date().getTime()-date.getTime()));
    }

